import React from "react";
import "./style.css";

function Featured(props) {
  return (
    <div className="card" id="feature-card">
      <div className="card-content">
      <span className="card-title">Title should be props</span>
      <p src ={props.name}></p>
      </div>
    </div>
  );
}

export default Featured;
